import React, { useEffect, useState } from 'react'

const App = () => {
  const [num, updatedNum] = useState(0);
  useEffect(
    () => {
      alert("Hello sir");
    }
  );
  return (
    <>
      <button onClick={
        () => {
          updatedNum(num + 1)
        },
        () => {
          alert("Hello Sir");
        }
      }>Click Here {num}</button>
    </>
  )
};

export default App
